import React, { Component } from "react";
import {
  HashRouter
} from "react-router-dom";

import MiniDrawer from "./Components/MiniDrawer";

class Main extends Component {
  render() {
    return (
      <HashRouter>
        <div>
          <div className="content">
            <MiniDrawer/>
          </div>

        </div>
      </HashRouter>
    );
  }
}

export default Main;
